import React, { Component } from "react";
const [name, setName] = useState("");

export default class HomeInputFields extends Component {
  onChangeName = (event) => {
    setName(event.target.value);
    this.props.reloadHomeDataFromInput(event.target.value);
  };
  render() {
    return (
      <div>
        <input type="name" onChange={this.onChangeName} value={name}></input>
        <button>add</button>
        <h2>{name}</h2>
      </div>
    );
  }
}
